import React, {useState} from 'react'
import * as Styled from './styles.js'

const SideBar = ({currentUsers}) => {
	return ( 
		<Styled.SideBar>
			{currentUsers.map((user) => {
				return <li> {user}</li>
			})}
		</Styled.SideBar>
	)
}

export default SideBar
